import React from 'react'
import {Route} from 'react-router-dom'

function MyMenu()
{
    return (
          <div>
            <Route>
            <Route path="/login"  />
            <Route path="/home"  />
            <Route path="/calculator"  />
            <Route path="/parentchild"  />
          </Route>
          </div>
        
      );

}
export default MyMenu
